import React from 'react';
import TextButton from './TextButton';
/**
 * @return {object}
 */
function ButtonBar() {
  return (
    <div>
      <TextButton/>
      <TextButton/>
      <TextButton/>
    </div>
  );
}

export default ButtonBar;
